import { createSelector } from '@reduxjs/toolkit';

// Selector to get admin dashboard data
export const selectAdminDashboardData = (state) => state.admin.dashboardData;

// Selector to get admin loading state
export const selectAdminLoading = (state) => state.admin.loading;

// Selector to get admin error
export const selectAdminError = (state) => state.admin.error;

// Selector to get user details
export const selectUserDetails = (state) => state.admin.users;
